import React from 'react';
import {Form, FormGroup, Button, Label, Input} from 'reactstrap';

export default class RegisterForm extends React.Component{
    render() {
        return(
            <Form>
                <FormGroup>
                    <Label for="firstName">First Name</Label>
                    <Input type="text" name="firstName" id="inputFirstName" placeholder="Your First Name"></Input>
                </FormGroup>
                <FormGroup>
                    <Label for="lastName">Last Name</Label>
                    <Input type="text" name="lastName" id="inputLastName" placeholder="Your Last Name"></Input>
                </FormGroup>
                <FormGroup>
                    <Label for="email">Email</Label>
                    <Input type="email" name="email" id="inputEmail" placeholder="Your Email Address"></Input>
                </FormGroup>
                <FormGroup>
                    <Label for="password">Password</Label>
                    <Input type="password" name="password" id="inputPassword" placeholder="Your Password"></Input>
                </FormGroup>
                
            </Form>

        );
    }
}
